import React, { Component } from "react";
import barclay from "../assets/barclay.png";
import manchester from "../assets/manchester.png";
import supercontest from "../assets/supercontest.jpg";
import tottenham from "../assets/tottenham.jpg";

var axios = require("axios");
class Home extends Component {
  constructor() {
    super();
  }

  // componentDidMount() {
  //   Axios.get("/api/scrape");
  // }

  render() {
    return (
      <div className="logoBackground">
        <img src={barclay} alt="" />

        <div className="homepage">
          <img src={manchester} alt="" />
        </div>
        <div className="sport">
          <img src={supercontest} alt="background" />
        </div>
        <div className="slide">
          <img src={tottenham} alt="craig" />
        </div>

        <nav className="navbar navbar-expand-lg navbar-light bg-light">
          <a className="navbar-brand" href="#">
            Sports Betting With Points{" "}
          </a>

          <div classsName="collapse navbar-collapse" id="navbarNavDropdown" />
        </nav>

        <div
          id="carouselExampleControls"
          className="carousel slide"
          data-ride="carousel"
        >
          <div className="carousel-inner">
            <div className="carousel-item active">
              <img src="{manchester}" className="d-block w-100" alt="..." />
            </div>
            <div className="carousel-item">
              <img src="..." className="d-block w-100" alt="..." />
            </div>
            <div className="carousel-item">
              <img src="..." className="d-block w-100" alt="..." />
            </div>
          </div>
          <a
            className="carousel-control-prev"
            href="#carouselExampleControls"
            role="button"
            data-slide="prev"
          >
            <span className="carousel-control-prev-icon" aria-hidden="true" />
            <span className="sr-only">Previous</span>
          </a>
          <a
            className="carousel-control-next"
            href="#carouselExampleControls"
            role="button"
            data-slide="next"
          >
            <span className="carousel-control-next-icon" aria-hidden="true" />
            <span className="sr-only">Next</span>
          </a>
        </div>
      </div>
    );
  }
}

export default Home;
